import './Item.css';
import RemoveIcon from '../Icons/RemoveIcon/RemoveIcon';

function Item({ item, remove }) {
  return (
    <tr className="item" key={item.id}>
      <td className="item_td">{item.username}</td>
      <td className="item_td">{item.email}</td>
      <td className="item_td">{item.registration_date}</td>
      <td className="item_td">{item.rating}</td>
      <td className="item_td">
        <span className='btn' onClick={() => remove(item.id)}>
          <RemoveIcon />
        </span>
      </td>
    </tr>
  );
}

export default Item;
